import { Box, Paper, Typography } from "@mui/material";
import React from "react";

function SeccionListadoPersonas() {
    return (
        <>
            <Paper {...paperStyle}>
                <Box sx={{ p: 1 }}>
                    <Typography variant={"h5"}>Filtros</Typography>
                    <Divider />
                </Box>
            </Paper>
        </>
    );
}

export default SeccionListadoPersonas;
